《'''{{lj|銀河図書館}}'''》是游戏[[偶像大师 灰姑娘女孩 星光舞台]]的原创歌曲，由[[鹭泽文香]]（CV：[[M·A·O]]）演唱，收录于2018年7月18日发布的专辑《THE IDOLM@STER CINDERELLA GIRLS STARLIGHT MASTER 19 With Love》。

== 简介 ==
文香的第二首个人曲，与讲述文香自己的《[[Bright Blue]]》不同，本曲描绘了故事编织出的幻想世界，词和曲都充满了VOCALOID味。

最有特点的是歌曲的整个后半段，文香都没有唱歌，而是娓娓道来一个故事，充满透明感的温柔声音把听者带入了诗意又梦幻的世界，非常有[[文学少女]]风范。

顺带一提，作词作曲编曲全包的{{lj|烏屋茶房}}是公认的文香P。

